import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

// react router
import { Router, Route, Routes } from 'react-router-dom';
// pages
import Home from './Home';
import About from './About';


const App = () => {
return (
    <>
    <Routes>
<Route  path="/">
<Home></Home>
</Route>
<Route  path="About/">
<About></About>

</Route>
</Routes>
</>
)
};

export default App;
